আজকে তিনদিন ধরে এই গানটা যেন আমাকে একটা ঘোরের মধ্যে রেখে দিয়েছে। অবিশ্বাস্য রকমের অসাধারণ সংগীতের পরিবেশন করেছে Coke Studio Bangla। জানতাম ভালো হবে, কিন্তু সেটা এতটা ভালো হবে আশা করতে পারিনি। আগের দুটো গানও দুর্দান্ত পরিবেশন করেছিল ওরা, কিন্তু এইবারে যেন সবকিছু ছাপিয়ে গেছে। আর Saxophone এর এতো অসাধারণ ব্যবহার অনেকদিন উপমহাদেশের কোনো গানে শুনিনি। অনেকগুলো style এর দুর্দান্ত fusion ঘটিয়েছে : Balkan, Eastern European, Cuban, Flamenco, Latin, Jazz, Ghazal, এবং তার সাথে বাংলার বিশুদ্ধ নজরুলগীতি, মিলেমিশে সুরের এক মায়াবী স্বর্গপুরী বানিয়ে ফেলেছে। এই সুরের মাদকতা বড়োই গভীর। এই ঘোরটা চলবে। আর শেষমেশ বলতেই হয়, Coke Studio সবসময়ই দুর্দান্ত সংগীত উপহার দিয়েছে, কিন্তু এই বাংলাদেশের পরিবেশনা গুলো হয়তো অনেক পরে হচ্ছে বলেই আরো উন্নত হয়েছে, কিন্তু এখনো পর্যন্ত অনেকটাই এগিয়ে বাকি সবকটা পরিবেশনা থেকে। সত্যিই Pure Magic। Kudos to Coke Studio Bangla, and all the musical maestros associated with it. respect and lots of love.

